import React from 'react';

function ResumeList({ resumes }) {
  const viewResume = (resume) => {
    alert(`Viewing Résumé: ${resume.fullName}`);
    // Navigate to a detailed view or pass data to a modal
  };

  return (
    <div>
      <h2>Résumés</h2>
      {resumes.length === 0 ? (
        <p>No résumés created yet.</p>
      ) : (
        <ul>
          {resumes.map((resume) => (
            <li key={resume.id}>
              {resume.fullName}
              <button onClick={() => viewResume(resume)}>View</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default ResumeList;
